message:
Curiosidade

Castelo de Spiš

 Um dos maiores complexos de castelos da Europa Central ergue-se em um cone de travertino de 634 metros de altura em Spiš, no nordeste da Eslováquia.  Suas paredes externas cobrem uma área de bons 41.000 m², tornando as ruínas do Castelo de Spis uma visão verdadeiramente majestosa.

